import React,{useState} from 'react';

export default function Embed (props) {
    let link = `/Project?name=${props.name}`

    const [hover, setHover] = useState(false)

    return (
      <div className = "profile-section">
        <button className="section-entry"  onMouseEnter={()=> setHover(true)} onMouseLeave={()=> setHover(false)}></button>
        {/* <div className="section-title">{props.name}</div> */}
        <iframe className = "section-entry" src= {props.src} frameborder="0" width="600" height="300" allowfullscreen="true" mozallowfullscreen="true" webkitallowfullscreen="true"></iframe>
        <img className={`play-entry-button ${hover ? "Show" : ""}`} src = "./content/Images-Profile/playbutton.png"/>
        <div className="entry-title">{props.name}</div>
      </div>
    );
  }
